import { Link, Route, Routes } from 'react-router-dom';
import UserDetail from './UserDetail';

function ListUsers({ users }) {

  return (
    <>
      <h1>Usuarios</h1>
      <ul>
        {users.map((u, index) => (
          <li key={index}>
            <Link to={"/api/users/" + u.id}>{u.usuario}</Link>
          </li>
        ))}
      </ul>
    </>
  )
}

export default ListUsers
